import { React, useState } from "react";
import Cards from "../../Components/Cards/cards";
import Cardbar from "../../Components/CardBar/cardbar";
import "./main.css";
import { Link } from "react-router-dom";
import Header from "../../Layout/Header/secondaryHeader";
import FilterIcn from "../../Assets/Icons/Filter";
import Filter from "../../Components/Filter/filter";
const Main = () => {
  const [filter, setFilter] = useState(false);
  const handleClick = () => {
    setFilter(!filter);
  };
  return (
    <div className=" container flex">
      <div className=" mt-[12rem]  flex  items-start justify-center  ">
        <div className=" sticky top-[100px]  left-[200px] hidden   filterStarting:hidden filterEnding:block ">
          <Filter />
        </div>
        <span
          className="hidden filterStarting:flex filterEnding:hidden  "
          onClick={handleClick}
        >
          <div className="  rounded-full bg-SecondaryWhite px-[7px] py-[7px]">
            <FilterIcn />
          </div>
        </span>
      </div>
      <div className=" flex flex-col px-[20px] md:px-0 ">
        <Header />

        <div className=" mt-[2rem] flex flex-col gap-3  ">
          <Cardbar />
          <Cards />
        </div>
      </div>
      {/* <div className=" mt-[12rem] w-[35rem]    items-start justify-center pl-[2rem]  ">
        <div className="hidden h-[20rem]  rounded-xl bg-white tablet:block "></div>
      </div> */}
    </div>
  );
};

export default Main;
